import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // Optional if you have a CSS file
import App from './App'; // This assumes your main component is in App.js

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
